import { Link } from "react-router-dom";

function Register(props) {


    return(
        <div className="register">
            <p className="register__entry">Регистрация</p>
            <form className="register__form">
                <input name="email" type="email" placeholder="Email" className="register__input"></input>
                <input name="password" type="password" placeholder="Пароль" className="register__input"></input>
                <button className="register__button" type="submit">Зарегистрироваться</button>
            </form>
            <p className="register__quest">Уже зарегистрированы? <Link to="/login" className="register__link">Войти</Link></p>
        </div>
    )
}

export default Register;
